define({"topics" : [{"title":"HTTP Method","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_t4k_2hh_jw","attributes": {"data-id":"concept_t4k_2hh_jw",},"menu": {"hasChildren":true,},"tocID":"concept_t4k_2hh_jw-d46e83841","next":"concept_t4k_2hh_jw-d46e83841",},{"title":"Parallel Requests","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor sends multiple requests at a time. To preserve record order,         the processor waits until all\n                  requests for the entire batch are completed before processing         the next batch.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_d3m_yrn_jw","attributes": {"data-id":"concept_d3m_yrn_jw",},"menu": {"hasChildren":false,},"tocID":"concept_d3m_yrn_jw-d46e83895","topics":[]},{"title":"OAuth 2 Authorization","shortdesc":"\n               <p class=\"shortdesc\">You can configure the HTTP Client processor to use the OAuth 2 protocol to connect to an         HTTP service that uses basic,\n                  digest, or universal authentication, OAuth 2 client         credentials, OAuth 2 username and password, or OAuth 2 JSON Web\n                  Tokens (JWT).\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_s4p_15f_5y","attributes": {"data-id":"concept_s4p_15f_5y",},"menu": {"hasChildren":true,},"tocID":"concept_s4p_15f_5y-d46e83940","next":"concept_s4p_15f_5y-d46e83940",},{"title":"Generated Output","shortdesc":"\n               <p class=\"shortdesc\"></p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_yqv_23v_bhb","attributes": {"data-id":"concept_yqv_23v_bhb",},"menu": {"hasChildren":true,},"tocID":"concept_yqv_23v_bhb-d46e84223","next":"concept_yqv_23v_bhb-d46e84223",},{"title":"Logging Request and Response Data","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor can log request and response data to the <span class=\"ph\">Data Collector</span>         log.\n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_dhg_gmk_hdb","attributes": {"data-id":"concept_dhg_gmk_hdb",},"menu": {"hasChildren":false,},"tocID":"concept_dhg_gmk_hdb-d46e84421","topics":[]},{"title":"Logging the Resolved Resource URL","shortdesc":"\n               <p class=\"shortdesc\">You can write the resolved resource URL to the <span class=\"ph\">Data Collector</span> log. \n               </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_kjb_gfz_m2b","attributes": {"data-id":"concept_kjb_gfz_m2b",},"menu": {"hasChildren":false,},"tocID":"concept_kjb_gfz_m2b-d46e84540","topics":[]},{"title":"Data Formats","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor writes the server response to the specified output field in         the record. </p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_jrj_hmh_jw","attributes": {"data-id":"concept_jrj_hmh_jw",},"menu": {"hasChildren":false,},"tocID":"concept_jrj_hmh_jw-d46e84669","topics":[]},{"title":"Configuring HTTP Client Processor","shortdesc":"\n               <p class=\"shortdesc\">Configure an HTTP Client processor to perform requests against a resource         URL.</p>\n            ","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#task_z54_1qr_fw","attributes": {"data-id":"task_z54_1qr_fw",},"menu": {"hasChildren":false,},"tocID":"task_z54_1qr_fw-d46e84805","topics":[]}]});